import React from 'react';
import { Button, Container } from 'semantic-ui-react';
import { Link, withRouter } from 'react-router-dom';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const guestButtons = (
    <Container textAlign='center'>
      <Button
      floated='right'
        content='Login'
        onClick={() => history.push('/login')}
        inverted
        color='red'
      />

      <Button
            floated='right'

        content='Sign Up'
        onClick={() => history.push('/signup')}
        inverted
        color='red'
      />
    </Container>
  );

  const authButtons = (
    <Container text textAlign='justified'>
      <Button
        onClick={() => history.push('/search')}
        floated
        inverted
        color='red'
        content='Search'
      />

      <Button
        content='Profile'
        onClick={() => history.push('/profile')}
        inverted
        color='red'
      />

      <Button inverted content='Logout' color='red' onClick={logout} />
    </Container>
  );
  return <>{currentUser ? authButtons : guestButtons}</>;
};

export default withRouter(NavBar);
